pragma solidity >=0.4.22 <0.8.0;

contract Publications {

    //Eventos
    event PropiedadTransferida(address indexed _previoDueno, address indexed _nuevoDueno);
    event NuevoPaperGuardado(address indexed _hashRemitente, uint _hashId, string _hashContenido, uint vartiempo);
    event Retiro(address indexed _hashRemitente, uint cantidad);

    //Estructura
    struct Paper {
        // Direccion remitente
        address remitente;
        // Hash contenido
        string contenido;
        // Tiempo
        uint vartiempo;
    }

    // Mapeo de Papers
    mapping(uint => Paper) public papers;
    // Dueno de Contrato
    address public dueno;
    // Ultimo Hash Id guardado
    uint public ultimoPaperId;
    // Precio del servicio en Wei
    uint public precio;

    //Modificadores
    modifier unicoDueno() {
        require(msg.sender == dueno);
        _;
    }

    //Funciones publicas
    /**
    * @dev Constructor de Contrato
    * @param _precio Service precio
    */
    constructor(uint _precio) public {
        // verificar si el precio es valido
        require(_precio > 0);

        // Asignacio de dueno
        dueno = msg.sender;
        // Asignacion de precio
        precio = _precio;
        // inicializacion de ids
        ultimoPaperId = 0;
    }

    /**
    * @dev Transferencia de propiedad de contrato
    * @param _nuevoDueno Direccion de nuevo dueno
    */
    function TransferirPropiedad(address _nuevoDueno) unicoDueno public {
        // check address not null
        require(_nuevoDueno != address(0));

        // assign new owner
        dueno = _nuevoDueno;

        // Log
        emit PropiedadTransferida(dueno, _nuevoDueno);
    }

    /**
    * @dev Retiro de saldo acumulado de contrato en eth
    */
    function retiroBalance() unicoDueno public {
        uint cantidad = address(this).balance;
        address payable duenoa = address(uint160(dueno));

        // transferencia de balance
        duenoa.transfer(address(this).balance);

        // Log
        emit Retiro(dueno, cantidad);
    }

    /**
    * @dev Guardar nuevo paper
    * @param _hashContenido COntenido Hash
    */
    function guardarPaper(string memory _hashContenido) private returns (uint _paperId) {
        // crear Hash
        uint paperId = ++ultimoPaperId;
        papers[paperId].remitente = msg.sender;
        papers[paperId].contenido = _hashContenido;
        papers[paperId].vartiempo = block.timestamp;

        return(paperId);
    }

    /**
    * @dev guardarNuevoPaper nuevo hash
    * @param _hashContenido Hash Contenido
    */
    function guardarNuevoPaper(string memory _hashContenido) payable public {
        // SOlo se guarda si se pago el servicio
        require(msg.value >= precio);

        // crear Hash
        uint paperId = guardarPaper(_hashContenido);

        // Log
        emit NuevoPaperGuardado(papers[paperId].remitente, paperId, papers[paperId].contenido, papers[paperId].vartiempo);
    }

    /**
    * @dev Encontrar paper por Id
    * @param _id Hash Id
    */
    function getPaperByID(uint _id) view public returns (address hashSender, string memory hashContent, uint hashTimestamp) {   
        return (papers[_id].remitente,papers[_id].contenido, papers[_id].vartiempo);
    }

    /**
    * @dev Encontrar el ultimo paper
    */
    function getLastPaperId() public view returns (uint _lastPaperId) {
        return ultimoPaperId;
    }

}
